            <Product imgName="product_4.png" prodTitle="TITLE 4" prodDisc="Dummy TEXT" style="left" />
        </Slide>
        <Slide right>
            <Product_1 imgName="product_1.png" prodTitle="TITLE 1" prodDisc="Dummy TEXT" style="right"/>
