        <Slide left>
            <Product imgName="product_2.png" prodTitle="TITLE 2" prodDisc="Dummy TEXT" style="left" />
        </Slide>
        <Slide right>
            <Product_1 imgName="product_3.png" prodTitle="TITLE 3" prodDisc="Dummy TEXT" style="right"/>
        </Slide>
        <style jsx>{`
            .product {
                padding - top: 10 % ;
